'use strict';
import { registerLanguage } from '../_.contribution.js';
registerLanguage({
    id: 'postiats',
    extensions: ['.dats', '.sats', '.hats'],
    aliases: ['ATS', 'ATS/Postiats'],
    loader: function () { return import('./postiats.js'); }
});
